import React from "react";
// import

import { Range, getTrackBackground } from "react-range";
// import * as ReactRange from "react-range";

const CollapsibleSlider = ({ min, max, step, values, onChange }) => {
  const handleChange = (newValues) => {
    // The event parameter is not needed here
    onChange(newValues); // Call the onChange prop with new values
  };

  console.log(values);

  return (
    // <div>
    <div
      style={{
        display: "flex",
        justifyContent: "center",
        margin: "10px",
      }}
    >
      <Range
        values={values}
        step={step}
        min={min}
        max={max}
        onChange={handleChange}
        renderTrack={({ props, children }) => (
          <div
            onMouseDown={props.onMouseDown}
            onTouchStart={props.onTouchStart}
            style={{
              ...props.style,
              height: "5px",
              width: "100%",
              background: getTrackBackground({
                values,
                colors: ["#ccc", "#548BF4", "#ccc"],
                min,
                max,
              }),
            }}
          >
            {children}
          </div>
        )}
        renderThumb={({ props }) => (
          <div
            {...props}
            style={{
              ...props.style,
              height: "10px",
              width: "10px",
              background: "#FFF",
              border: "2px solid #CCC",
              borderRadius: "50%",
              cursor: "pointer",
            }}
          />
        )}
      />
    </div>
    // </div>
  );
};

export default CollapsibleSlider;
